import React from "react";
import Logo from "../Logo";
import MenuItem from "../MenuItem";

const MenuContainer = () => {
  return (
    <aside className="menu">
      <Logo />
      <div className="items">
        <MenuItem title="Home" icon="fa-house" />
        <MenuItem title="Notifications" icon="fa-bell" />
        <MenuItem title="Messages" icon="fa-envelope" />
        <MenuItem title="Profile" icon="fa-user" />
        <MenuItem title="More" icon="fa-ellipsis" />
      </div>
    </aside>
  );
};

export default MenuContainer;
